export const Advisor = ({ entry, loading }) => {

    return (
        <tr>
            <td>{entry.Bedrijfsnaam}</td>
            <td>{entry.Adres}</td>
            <td>{entry.Postcode}</td>
            <td>{entry.Woonplaats}</td>
            <td><a href={entry.Website}>{entry.Website}</a></td>
        </tr>
    )
}
